import React from "react";

function App (){
  return (
    <div>
      <header>
        <h1>Welcome to the Pokedex</h1>
        <img src="https://assets.pokemon.com/assets/cms2/img/pokedex/full/016.png"></img>
      </header>
    </div>
  );
}

function Logo(){
  <header>
    <h1>Welcome to the Pokedex</h1>
    <img src="https://assets.pokemon.com/assets/cms2/img/pokedex/full/016.png"></img>
  </header>;
}
export default App;
